import React from 'react';


function GoogleMap() {

  const url = ``;

  return (
    <>
      <div className="row w-100">
        <iframe
          title="unique title"
          width="450"
          height="600"
          frameborder="0"
          src={url}
          allowfullscreen>
        </iframe>
      </div>
    </>
  );
};

export default GoogleMap;
